import React from "react";

class Settings extends React.Component {
  render() {
    return (
      <div className="sidebar">
        <ul>
          <li>
            <a href="#">Home</a>
          </li>
          <li className="dropdown">
            <a href="#">My Topics</a>
            <div className="dropdown-content">
              <a href="#">Topic 1</a>
              <a href="#">Topic 2</a>
            </div>
          </li>
          <li>
            <a href="#">Settings</a>
          </li>
        </ul>
      </div>
    );
  }
}

export default Settings;
